    align-items: center;
    background: #ebf3fe;
    border: 1px solid #a9c4df;
    margin-bottom: 20px;
    span{
        padding-left: 10px;
    }
}
.one{
    margin: 20px 0;
    .zuti{
        color: black;
        font-weight: 1000;
        padding-left: 10px;
    }
    .xiti{
        color: #727e95;
        padding-right: 10px;
    }
}
.two{
    display: flex;
    justify-content: space-between;
    margin-bottom: 100px;
    .left{
        padding-left: 10px;
        color: black;
        font-weight: 1000;
        display: inline-block;
        width: 6%;
    }
    .right{
        display: inline-block;
        width: 92%;
        word-wrap: break-word;
        word-break: normal;
        text-align: justify;
        padding-right: 40px;
    }
}
.neirong{
    width: 100%;
    margin: 20px 0;
    input{
        width: 100%;
        padding-bottom: 200px;
        outline: none;
        border: 1px solid #a9c4df;
    }
}
.btu{
    float: right;
    button{
        padding: 10px 40px;
        color: white;
        background: #1b9dff;
        border: none;
    }
}
